import React from "react";
import {OrgDiagram} from 'basicprimitivesreact';
import primitives from 'basicprimitives';

var photos = {
    a: 'data:image/png;base64,',
    b: 'data:image/png;base64,',
    c: 'data:image/png;base64,'
};

export function Main() {
    const config = {
        pageFitMode: primitives.common.PageFitMode.AutoSize,
        autoSizeMinimum: {width: 100, height: 100},
        cursorItem: 0,
        highlightItem: 0,
        hasSelectorCheckbox: primitives.common.Enabled.True,
        items: [
            {
                id: 0,
                parent: null,
                title: 'Scott Aasrud',
                description: 'VP, Public Sector',
                image: photos.a
            },
            {
                id: 1,
                parent: 0,
                title: 'Ted Lucas',
                description: 'VP, Human Resources',
                image: photos.b
            },
            {
                id: 2,
                parent: 0,
                title: 'Fritz Stuger',
                description: 'Business Solutions, US',
                image: photos.c
            }
        ]
    };


    return (
        <main role="main">

            <section className="jumbotron text-center">
                <div className="container">
                    <h1>Album example</h1>
                    <p className="lead text-muted">Something short and leading about the collection below—its contents,
                        the creator, etc. Make it short and sweet, but not too short so folks don’t simply skip over it
                        entirely.</p>
                    <p>
                        <a href="#" className="btn btn-primary my-2">Main call to action</a>
                        <a href="#" className="btn btn-secondary my-2">Secondary action</a>
                    </p>
                </div>
            </section>

            <div className="album py-5 bg-light">
                <div className="container">

                    <div className="row justify-content-center">
                        <OrgDiagram centerOnCursor={true} config={config} />

                    </div>
                </div>
            </div>

        </main>
    )

}
